import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container: {
        flex: 1,
        position: 'relative',
        width: '100%',
        backgroundColor: '#fff',
        top: 0
    },
    header: {
        flexDirection: 'row',
        marginTop: 40,
        paddingHorizontal: 16,
        justifyContent: 'space-between'
    }
});

export default styles;
